void TensorGUI::cb_Compute_i(Fl_Button*, void*) {
  std::vector<unsigned int> vector_indices;
for (unsigned int i =0;i<31;i++) {
if (chk[i]->value() == true) vector_indices.push_back(i);
}
std::vector<unsigned int> ind_measures;
for (unsigned int i =0;i<3;i++) {
if (m_ROImeasure[i]->value() == true) ind_measures.push_back(i);
}
if (m_ROImeasure[3]->value() == true) {
ind_measures.push_back(3);
ind_measures.push_back(4);
ind_measures.push_back(5);
}
if (m_ROImeasure[4]->value() == true) {
ind_measures.push_back(6);
ind_measures.push_back(7);
ind_measures.push_back(8);
}
for (unsigned int i =5;i<11;i++) {
if (m_ROImeasure[i]->value() == true) ind_measures.push_back(i+4);
}
this->EvaluateTractRegion(vector_indices,ind_measures,m_Coherence->value());
this->ShowROIsMeasures();
}
